DROP TABLE IF EXISTS `z_vehicle_insurance`;
CREATE TABLE `z_vehicle_insurance` (
  `id` varchar(64) NOT NULL DEFAULT '',
  `create_by` varchar(64) DEFAULT NULL COMMENT '创建者',
  `update_by` varchar(64) DEFAULT NULL COMMENT '更新者',
  `del_flag` varchar(1) DEFAULT NULL COMMENT '删除标记（0：正常；1：删除；2：审核）',
  `create_date` datetime DEFAULT NULL COMMENT '创建日期',
  `update_date` datetime DEFAULT NULL COMMENT '更新日期',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注信息',
  `vehicle_num` varchar(50) DEFAULT NULL COMMENT '车号',
  `vehicle_type` varchar(50) DEFAULT NULL COMMENT '车型',
  `frame_num` varchar(50) DEFAULT NULL COMMENT '车架号',
  `engine_num` varchar(50) DEFAULT NULL COMMENT '发动机号',
  `reg_date` datetime DEFAULT NULL COMMENT '登记日期',
  `insurance_company` varchar(50) DEFAULT NULL COMMENT '保险公司',
  `premium` varchar(50) DEFAULT NULL COMMENT '交强险-保费',
  `closing_date` datetime DEFAULT NULL COMMENT '交强险-截止日期',
  `third_party_premium` varchar(50) DEFAULT NULL COMMENT '商业险-三者/保费',
  `third_party_insured_amount` varchar(50) DEFAULT NULL COMMENT '商业险-三者/保额',
  `car_damage_insurance` varchar(50) DEFAULT NULL COMMENT '商业险-车损险',
  `risk_spontaneous_combustion` varchar(50) DEFAULT NULL COMMENT '商业险-自燃险',
  `non_deductible` varchar(50) DEFAULT NULL COMMENT '商业险-不计免赔',
  `other_insurance` varchar(50) DEFAULT NULL COMMENT '商业险-其他险种',
  `closing_date1` datetime DEFAULT NULL COMMENT '商业险-截止日期',
  `premium1` varchar(50) DEFAULT NULL COMMENT '道路客运承运人责任险-保费',
  `insured_amount1` varchar(50) DEFAULT NULL COMMENT '道路客运承运人责任险-保额',
  `closing_date2` varchar(50) DEFAULT NULL COMMENT '道路客运承运人责任险-截止日期',
  `vehicle_vessel_tax` varchar(50) DEFAULT NULL COMMENT '车船税',
  `total_premium` varchar(50) DEFAULT NULL COMMENT '保费总合计',
  `compulsory_insurance_num` varchar(50) DEFAULT NULL COMMENT '交强险保单号',
  `commercial_insurance_order_num` varchar(50) DEFAULT NULL COMMENT '商业险保单号',
  `carrier_warranty_num` varchar(50) DEFAULT NULL COMMENT '承运人保单号',
  `mark` varchar(255) DEFAULT NULL COMMENT '备注',
  `driver_license` varchar(50) DEFAULT NULL COMMENT '驾照',
  `query_code` varchar(50) DEFAULT NULL COMMENT '查询码',
  `pic` varchar(255) DEFAULT NULL COMMENT '交强险保单图片',
  `pic1` varchar(255) DEFAULT NULL COMMENT '商业险保单图片',
  `pic2` varchar(255) DEFAULT NULL COMMENT '承运人保单图片',
  `handle_date` datetime DEFAULT NULL COMMENT '办理日期',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='车辆投保情况查询';

